import 'dart:io';

import 'package:flutter/material.dart';
import 'package:image_picker/image_picker.dart';
import 'package:flutter_gen/gen_l10n/app_localizations.dart';
import 'package:project/MyDesign/text_field.dart';
import 'package:project/student/personal%20setting/training/training.dart';

class ContentBottomSheet extends StatefulWidget {
  bool visible = false;
  Function(PostArg) callBak;

  ContentBottomSheet(this.callBak);


  @override
  State<ContentBottomSheet> createState() => _ContentBottomSheetState();
}

class _ContentBottomSheetState extends State<ContentBottomSheet> {
  File? imageFile;
  var title = TextEditingController();
  var description = TextEditingController();
  GlobalKey<FormState> formKey = GlobalKey<FormState>();
  var url='data:image/png;base64,';

  @override
  Widget build(BuildContext context) {

    return Container(
        child: Form(
        key: formKey,
          child: SingleChildScrollView(
            child: Column(
              children: [
              Container(
                  margin: EdgeInsets.only(top: 20, left: 20, right: 20),
                  child: TextFormField(
                      validator: (text) {
                        if (text == null || text
                            .trim()
                            .isEmpty)
                          return '${AppLocalizations.of(context)!
                              .please_enter} ${ AppLocalizations.of(context)!
                              .title}';
                        return null;
                      },
                      controller: title,
                      keyboardType: TextInputType.text,
                      decoration: InputDecoration(
                          prefixIcon: Icon(Icons.edit),
                          label: Text(
                            AppLocalizations.of(context)!.title,
                          ),
                          labelStyle: Theme
                              .of(context)
                              .textTheme
                              .bodyMedium,
                          hintText: AppLocalizations.of(context)!.enter_title,
                          hintStyle: Theme
                              .of(context)
                              .textTheme
                              .bodySmall,
                          border: OutlineInputBorder(
                            borderSide:
                            BorderSide(color: Theme
                                .of(context)
                                .canvasColor),
                          ),
                          enabledBorder: OutlineInputBorder(
                            borderSide:
                            BorderSide(color: Theme
                                .of(context)
                                .canvasColor),
                            borderRadius: BorderRadius.circular(10),
                          )))),

            Container(
                margin: EdgeInsets.only(top: 20, left: 20, right: 20),
                child: TextFormField(
                    validator: (text) {
                      if (text == null || text
                          .trim()
                          .isEmpty)
                        return '${AppLocalizations.of(context)!
                            .please_enter} ${ AppLocalizations.of(context)!
                            .description}';
                      return null;
                    },
                    controller: description,
                    maxLines: 3,
                    keyboardType: TextInputType.text,
                    decoration: InputDecoration(
                        prefixIcon: Icon(Icons.dehaze_sharp),
                        label: Text(
                          AppLocalizations.of(context)!.description,
                        ),
                        labelStyle: Theme
                            .of(context)
                            .textTheme
                            .bodyMedium,
                        hintText: AppLocalizations.of(context)!.enter_description,
                        hintStyle: Theme
                            .of(context)
                            .textTheme
                            .bodySmall,
                        border: OutlineInputBorder(
                          borderSide: BorderSide(color: Theme
                              .of(context)
                              .canvasColor),
                        ),
                        enabledBorder: OutlineInputBorder(
                          borderSide:
                          BorderSide(color: Theme
                              .of(context)
                              .canvasColor),
                          borderRadius: BorderRadius.circular(10),
                        )))),
            SizedBox(
              height: 15,
            ),
            Row(
                mainAxisAlignment: MainAxisAlignment.spaceAround,
                children: [
                ElevatedButton(
                onPressed: () {

    setState(() {});
    chooseImage();
    },
            child: Text(AppLocalizations.of(context)!.gallery_img)),
    Visibility(
    visible: widget.visible,
    child:                 imageFile==null?Icon(Icons.image):Image.file(imageFile!),
    ),
    ],
    ),
    SizedBox(
    height: 30,
    ),
    Container(
    alignment: Alignment.topRight,
    margin: EdgeInsets.all(15),
    child: ElevatedButton(
    onPressed: () {
    final p= PostArg(title.text,description.text,imageFile);
    if(formKey.currentState?.validate()==true){
      widget.callBak(p);
      Navigator.pop(context);
    }

    },
    child: Text(AppLocalizations.of(context)!.post)))
    ],
    ),
          ),
        ));
  }

  chooseImage() async {
    XFile? pickedFile = await ImagePicker().pickImage(
      source: ImageSource.gallery,
      maxHeight: 100,
      maxWidth: 100,
    );
    imageFile = File(pickedFile!.path);
    if (imageFile != null) widget.visible = true;

    setState(() {});
  }
}

class PostArg {
  String title ;
  String description ;
  File? img;

  PostArg(this.title, this.description, this.img);
}
